import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import LoginView from '../views/LoginView.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  },
  {
    path: '/login',
    name: 'login',
    component: LoginView
  },
  {
    path: '/inscription',
    name: 'home',
    component: HomeView
  },
  {
    path: '/inscription/preferences',
    name: 'home',
    component: HomeView
  },
  {
    path: '/livres/nouveautes',
    name: 'home',
    component: HomeView
  },
  {
    path: '/livres/biographies',
    name: 'home',
    component: HomeView
  },
  {
    path: '/livres/romans',
    name: 'home',
    component: HomeView
  },
  {
    path: '/livres/bandes-dessinees',
    name: 'home',
    component: HomeView
  },
  {
    path: '/livres/bandes-dessinees',
    name: 'home',
    component: HomeView
  },
  {
    path: '/livres/:livre',
    name: 'home',
    component: HomeView
  },
  {
    path: '/ma-librairie',
    name: 'home',
    component: HomeView
  },
  {
    path: '/ma-librairie/a-lire',
    name: 'home',
    component: HomeView
  },
  {
    path: '/ma-librairie/deja-lus',
    name: 'home',
    component: HomeView
  },
  {
    path: '/admin/back-office',
    name: 'home',
    component: HomeView
  },
  {
    path: '/admin/back-office/utilisateurs',
    name: 'home',
    component: HomeView
  },
  {
    path: '/admin/back-office/livres',
    name: 'home',
    component: HomeView
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
